import React from "react";
import { Link } from "react-router-dom"

export default function DeckCreateButton(){
  return (
    <div>
      <Link to="/decks/new" className="btn">
        <button className="btn btn-secondary">
          <i className="fas fa-plus"></i>Create Deck
        </button>
      </Link>
    </div>
  )
}
